	function lcCheck() {
		try {
			var timestampkey = lctest + "-" + new Date().getTime();
			var testvalue = new Array(1000).join(lctest);
			localStorage.setItem(timestampkey, testvalue);
			localStorage.removeItem(timestampkey);
			return true;
		} catch (e) {
			return false;
		}
	}
</script>
